import CardProduct from "components/CardProduct/CardProduct";
import React from "react";

// reactstrap components
import { Card, CardHeader, Row, Col, Form, CardGroup } from "reactstrap";


function Home() {
  return (
    <>
      <div className="content">
        <Row>
          <Col md="12">
            <Card>
              <CardHeader>Mais vendidos</CardHeader>
              <Form>
                <CardGroup>
                  <CardProduct/>

                  <CardProduct/>
                </CardGroup>
              </Form>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Home;
